import React from 'react';

const services = [
  {
    title: 'Web Design',
    desc: 'Modern, responsive websites tailored to your brand.',
    icon: 'üñ•Ô∏è',
    color: '#0057D9',
  },
  {
    title: 'Education Website',
    desc: 'Custom solutions for schools, colleges, and e-learning.',
    icon: 'üéì',
    color: '#2ECC71',
  },
  {
    title: 'Form Page',
    desc: 'Interactive and secure forms for your business needs.',
    icon: 'üìù',
    color: '#FF6B35',
  },
  {
    title: 'Client Website',
    desc: 'Professional websites for your clients and partners.',
    icon: 'üë•',
    color: '#0057D9',
  },
  {
    title: 'Custom Website',
    desc: 'Fully customized web solutions for any requirement.',
    icon: '‚öôÔ∏è',
    color: '#2ECC71',
  },
  {
    title: 'Bugs Finder',
    desc: 'Identify and fix bugs to keep your site running smoothly.',
    icon: 'üîç',
    color: '#FF6B35',
  },
];

function Services() {
  return (
    <div style={{ background: '#181A20', minHeight: '100vh', padding: '0 0 2rem 0' }}>
      <section className="responsive-section" style={{
        maxWidth: '1100px',
        margin: '0 auto',
        padding: '3rem 1rem',
      }}>
        <h1 style={{ color: '#0057D9', fontWeight: 800, fontSize: '2.5rem', marginBottom: '2.5rem', textAlign: 'center', letterSpacing: '1px' }}>
          Our Services
        </h1>
        <div className="responsive-grid" style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(260px, 1fr))',
          gap: '2rem',
        }}>
          {services.map(service => (
            <div className="responsive-card" key={service.title} style={{
              background: '#23272F',
              borderRadius: '1.2rem',
              boxShadow: '0 2px 12px rgba(0,0,0,0.06)',
              padding: '2.2rem 1.5rem',
              textAlign: 'center',
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              justifyContent: 'center',
              color: '#E5E7EB',
            }}>
              <div style={{ fontSize: '2.8rem', color: service.color, marginBottom: '1rem' }}>{service.icon}</div>
              <h2 style={{ color: service.color, fontWeight: 700, fontSize: '1.3rem', marginBottom: '0.7rem' }}>{service.title}</h2>
              <p style={{ color: '#E5E7EB', fontSize: '1.05rem', lineHeight: 1.6 }}>{service.desc}</p>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
}

export default Services;
